description:
Sibling Rivalry Sisters (Split Scenes)
~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~

Synopsis: Getting together for the holidays can be nerve wracking! Especially when you have two sisters vying for attention, Daddy's love and the same boyfriends. Starring Jodi Taylor and Karla Kush as the dueling sisters, Adriana Chechik as Daddy's crush, Xander Corvus and Van Wylde as the men they're fighting over and Steven St. Croix and Kylie Ireland as the Mom and Dad.

Cast: Jodi Taylor, Karla Kush, Adriana Chechik, Xander Corvus, Steven St. Croix, Van Wylde, James Avalon,Director

